INSERT INTO `comment` VALUES ('1', '这是本系统的第一个评论，人类将于2016年灭绝---\n为什么？怎么会？是谁？做了什么？\n面对众多疑问，研究者们陷入了疑惑。就在这时，他们观测到了新的异变。', '2018-03-18 23:07:08', '测试员', '5'), ('2', '这是本系统的第二个评论，公元2004年，日本某个地方都市，在这里，出现了前所未有的[无法观测的领域]\n为了保护与夺回人类未来，必须进行时间旅行重返过去，\n执行与“历史”对抗的作战！', '2018-03-18 23:10:38', '测试员', '5');
COMMIT;

